import React from 'react';

export function Notes() {
    return (
        <div className="col-sm-6">
            <h5><strong>Notes</strong></h5>
            <p><span style={{ fontStyle: 'italic' }}>Italic </span>text is editable</p>
            <p>You can only upload file in format JPG,JPEG,PNG,PDF,DOC & DOCX</p>
        </div>
    )
}
